import React from "react";
import companyLogo from "../../../common/images/logo.png";
import "./footer.css";
export default class Footer extends React.Component {
  render() {
    return (
      <footer class="footer">
        <div class="footerContainer">
          <div>
            <img className="companyLogo" src={companyLogo}></img>
          </div>
          <div>
            BrainHR IT Solutions is a team of highly skilled consultants and
            creative problem solvers who will help you reach your goals instead
            of just sell you a solution.
          </div>

          <div>
            <a
              href="https://www.linkedin.com/company/brainhr-it-solutions"
              target="_blank"
            >
              <span>
                <i className="fa-brands fa-linkedin"></i>
              </span>
            </a>
          </div>
        </div>
        <div class="copyright"></div>
      </footer>
    );
  }
}
